// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;
import "hardhat/console.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

/**ProductRegistration smart contract: In this smart contract, only producers can
register a product. Registered products can also be queried for. This 
smart contract also allows admin to grant producer role to any verified user */


contract ProductRegistration is AccessControl{
    bytes32 public constant PRODUCER_ROLE = keccak256("PRODUCER_ROLE");

    struct Product {
        uint productId;
        address producer;
        string quantity;
        string details;
        uint timestamp;
    }


    mapping(uint => Product) public products;
    uint public productCounter;

    event ProductRegistered(uint productId,address producer,string quantity,string details,uint timestamp);

    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(PRODUCER_ROLE, msg.sender);
    }

    function registerProduct(string memory details, string memory quantity) public onlyRole(PRODUCER_ROLE) {
        productCounter++;
        products[productCounter] = Product(productCounter, msg.sender,quantity, details, block.timestamp);

        emit ProductRegistered(productCounter, msg.sender, quantity, details, block.timestamp);
    }

    function getProduct(uint productId) public view returns (Product memory) {
        require(products[productId].productId  != 0, "Product does not exist");
        return products[productId];
    }

    function grantProducerRole(address account) public onlyRole(DEFAULT_ADMIN_ROLE) {
        grantRole(PRODUCER_ROLE, account);
    }


}

